(1457, '145701d8bae291b1e4724443375634ccfa0e', 'Casablanca', 'Maarif', '63, Boulvard Anfa، Rue Washington, Casablanca 20250', 'APIA Casablanca Anfa', 'APIA est une enseigne de production de transformation et de vente des produits de terroir. On allie un savoir faire acquis depuis plus de deux décennies et les dernières technologies pour donner à nos produits toutes les garanties de qualité supérieure. Ainsi tout les articles que nous commercialisons aussi bien dans nos magasins que sur notre site web sont produits par nos soins. Nous maitrisons toutes nos filières depuis la production jusqu’à la commercialisation du produit fini.', 'NATI', 'APIA', '212522205492', 0, 0, 0, 0, '2020-06-30 14:07:04', 'INTE', 82, '2020-07-13 16:14:56', NULL, '', ' Casablanca Maarif APIA Casablanca Anfa APIA est une enseigne de production de transformation et de vente des produits de terroir. On allie un savoir faire acquis depuis plus de deux decennies et les dernieres technologies pour donner a nos produits toutes les garanties de qualite superieure. Ainsi tout les articles que nous commercialisons aussi bien dans nos magasins que sur notre site web sont produits par nos soins. Nous maitrisons toutes nos filieres depuis la production jusqu’a la commercialisation du produit fini. APIA   '),
(1458, '14584dcae38ee11d3a6606cc6cd636a3628b', 'Casablanca', 'Maarif', '\nAngle rue Taha Hussein et rue Abou chouaib Addoukkali, Résidence Galeria N° 20, Quartier Gauthier (1,12 km)', 'LE ROSSIGNOL', 'Le Rossignol Restaurant , la nouvelle adresse bucolique au coeur de casablanca la restaurant qui proposait de s\'évader du côté de la Méditerranée le temps d\'un repas', 'AUCU', NULL, '212522275845', 0, 0, 0, 0, '2020-06-30 14:18:16', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Maarif LE ROSSIGNOL Le Rossignol Restaurant , la nouvelle adresse bucolique au coeur de casablanca la restaurant qui proposait de s\'evader du cote de la Mediterranee le temps d\'un repas    '),
(1459, '14591abb1e1ea5f481b589da52303b091cbb', 'Casablanca', 'Hay Hassani', 'Etage Magasin Appartement N 12 GH1/ E3 LOT AL KHOZAMA IMM 1A CASABLANCA', 'Terre Nature', 'une parfumerie qui vous propose:\n-Des produits terroirs 100% naturels\n-Tous genre de produits cosmétique\nlivraison partout au maroc via amana.', 'NATI', 'Terre Nature', '212662345701', 0, 0, 0, 0, '2020-06-30 14:19:12', 'INTE', 82, '2020-07-13 16:14:56', NULL, '', ' Casablanca Hay Hassani Terre Nature une parfumerie qui vous propose:\n-Des produits terroirs 100% naturels\n-Tous genre de produits cosmetique\nlivraison partout au maroc via amana. Terre Nature   '),
(1460, '146007042ac7d03d3b9911a00da43ce0079a', 'Casablanca', 'Maarif', '6, Rue Bab Ennasr, 2,0 km de Mosquée Hassan II ', 'Oncle Blend', 'L\'Oncle Blend propose une cuisine aux influences américaines revisitée. A mi-chemin entre le Steakhouse et la Brasserie française, le restaurant, ouvert pour le déjeuner et le diner, met aussi à disposition de ses clients un coin bar pour l\'apéritif avec une carte dédiée, une sélection de vins et de cocktails ainsi qu\'un large choix d\'alcools. ', 'AUCU', NULL, '212667755062', 0, 0, 0, 0, '2020-06-30 14:25:57', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Maarif Oncle Blend L\'Oncle Blend propose une cuisine aux influences americaines revisitee. A mi-chemin entre le Steakhouse et la Brasserie francaise, le restaurant, ouvert pour le dejeuner et le diner, met aussi a disposition de ses clients un coin bar pour l\'aperitif avec une carte dediee, une selection de vins et de cocktails ainsi qu\'un large choix d\'alcools.     '),
(1461, '146195151403b0db4f75bfd8da0b393af853', 'Casablanca', 'Maarif', '146, rue Abou Zaid Ad-Dadoussi Maârif', 'Al Mijhar Maarif المجهر المعاريف', 'Magasin de produits naturels d\'excellente qualité à des prix pas chers. (Épicerie, produits de la ruche, produits de terroir, compléments naturels, cosmétique naturelle, pain au levain, paniers bio, etc).', 'NATI', 'Al Mijhar', '212522232210', 2, 0, 0, 0, '2020-06-30 14:26:46', 'INTE', 82, '2020-07-13 16:14:56', NULL, '', ' Casablanca Maarif Al Mijhar Maarif المجهر المعاريف Magasin de produits naturels d\'excellente qualite a des prix pas chers. (Epicerie, produits de la ruche, produits de terroir, complements naturels, cosmetique naturelle, pain au levain, paniers bio, etc). Al Mijhar   '),
(1462, '1462ad71c82b22f4f65b9398f76d8be4c615', 'Casablanca', 'Maarif', '6-8 Rue Ahmed El Mokri, Casablanca 20000', 'ORGANIC KITCHEN', 'Organic Kitchen est un lieu dédié à la nourriture saine et savoureuse. C\'est un espace de vie, de partage et de convivialité qui met les bons produits au coeur de votre assiette.', 'VILL', NULL, '212522943775', 0, 0, 0, 0, '2020-06-30 14:32:26', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Maarif ORGANIC KITCHEN Organic Kitchen est un lieu dedie a la nourriture saine et savoureuse. C\'est un espace de vie, de partage et de convivialite qui met les bons produits au coeur de votre assiette.    '),
(1463, '1463fe70c36866add1572a8e2b96bfede7bf', 'Casablanca', 'Maarif', 'Rue Ziad bnou Riaa, centre benomar', 'Jour et Nuit ', 'Notre originalité est de produire des huiles issues d’une fabrication entièrement artisanale sans aucun additif ni adjuvant chimique.\n', 'NATI', 'Jour et Nuit ', '212612299480', 0, 0, 0, 0, '2020-06-30 14:36:42', 'INTE', 82, '2020-07-13 16:14:56', NULL, '', ' Casablanca Maarif Jour et Nuit  Notre originalite est de produire des huiles issues d’une fabrication entierement artisanale sans aucun additif ni adjuvant chimique.\n Jour et Nuit    '),
(1464, '1464c913303f392ffc643f7240b180602652', 'Casablanca', 'Maarif', '209 Boulevard Yacoub El Mansour, Casablanca 20100', 'THE KITCHEN CASA', 'The Kitchen\nPrêt à déguster !\nNouveau au Maroc Vivez une expérience culinaire exceptionnelle.\nPour chacune de nos recettes, nous maîtrisons parfaitement le couple temps et température de cuisson, pour favoriser la tendreté des fibres, la jutosité et la texture fondante des produits. Avec toujours une cuisson parfaitement homogène !', 'AUCU', NULL, '212522993708', 0, 0, 0, 0, '2020-06-30 14:38:33', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Maarif THE KITCHEN CASA The Kitchen\nPret a deguster !\nNouveau au Maroc Vivez une experience culinaire exceptionnelle.\nPour chacune de nos recettes, nous maitrisons parfaitement le couple temps et temperature de cuisson, pour favoriser la tendrete des fibres, la jutosite et la texture fondante des produits. Avec toujours une cuisson parfaitement homogene !    '),
