(1467, '14670245952ecff55018e2a459517fdb40e3', 'Casablanca', 'Derb Sultan Al Fida', '17 lot al farah , Bd alaymoun\nCasablanca', 'Ma Ferme', 'Nous sommes spécialisés dans la vente et la livraison de paniers de fruits et légumes frais de saison ( premier choix uniquement) au domicile des particuliers ou sur leur lieu de travail.', 'VILL', NULL, '212606515056', 1, 0, 0, 0, '2020-06-30 15:03:48', 'INTE', 82, '2020-07-13 16:05:39', NULL, '', ' Alimentation Generale 1  Casablanca Derb Sultan Al Fida Ma Ferme Nous sommes specialises dans la vente et la livraison de paniers de fruits et legumes frais de saison ( premier choix uniquement) au domicile des particuliers ou sur leur lieu de travail.    ');
