(1468, '1468cec6f62cfb44b1be110b7bf70c8362d8', 'Casablanca', 'Californie', 'Résidence Miamar, Boulevard Oulad Haddou, les Crêtes, Californie;', 'Green Village Californie Casablanca', 'Spécialiste de l\'alimentation et de la cosmétique biologique, La Vie Claire c\'\nUn très large choix de produits avec un rayon épicerie bio qui comprend des pâtes au quinoa, de l\'épeautre à la spiruline (une algue d’eau douce hyper-protéinée et très saine), des boissons au riz nature, au soja nature, du miel de fleur, de la pâte à tartiner sans lactose...\n\nLa Vie Claire Maroc commercialise des produits bio marocains, issue de la production locale. Quant au rayon fruits et légumes, l’enseigne La Vie Claire propose des légumes fraîchement récoltés.', 'NATI', 'Green Village ', '212522870871', 0, 0, 0, 0, '2020-06-30 15:14:13', 'INTE', 82, '2020-07-13 16:14:56', NULL, '', ' Alimentation Generale 1  Casablanca Californie Green Village Californie Casablanca Specialiste de l\'alimentation et de la cosmetique biologique, La Vie Claire c\'\nUn tres large choix de produits avec un rayon epicerie bio qui comprend des pates au quinoa, de l\'epeautre a la spiruline (une algue d’eau douce hyper-proteinee et tres saine), des boissons au riz nature, au soja nature, du miel de fleur, de la pate a tartiner sans lactose...\n\nLa Vie Claire Maroc commercialise des produits bio marocains, issue de la production locale. Quant au rayon fruits et legumes, l’enseigne La Vie Claire propose des legumes fraichement recoltes. Green Village    '),
(1469, '1469991de292e76f74f3c285b3f6d57958d5', 'Casablanca', 'Maarif', ' 47 Avenue Hassan Souktani, Casablanca 20250', 'BRASSERIE NICOLE', 'La Brasserie Nicole, un lieu convivial, dans un cadre typique de brasserie parisienne. vous y découvrirez d\'authentique plats de bistrot. au bar on vous propose une large gamme de vins et une carte de tapas. Une belle carte de vins et de tapas le tout en plein coeur de Gauthier\n', 'AUCU', NULL, '212522272722', 0, 0, 0, 0, '2020-06-30 15:15:45', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Maarif BRASSERIE NICOLE La Brasserie Nicole, un lieu convivial, dans un cadre typique de brasserie parisienne. vous y decouvrirez d\'authentique plats de bistrot. au bar on vous propose une large gamme de vins et une carte de tapas. Une belle carte de vins et de tapas le tout en plein coeur de Gauthier\n    '),
(1470, '147042ffcf057e133f94c1b7b5cf543ef3bd', 'Casablanca', 'Hay Al Mohammadi', '128 , Angle Rue De jabbal Oukaimden Boulevard Du Fouarat', 'Pâtisserie Moyen Atlas', 'Créer en 1982 à Casablanca, Moyen Atlas a pu réaliser une éventuelle progression en savoir-faire et qualité de ces produits Boulangerie ou Pâtisserie. Depuis ce temps-là l\'innovation a pu se mettre en priorité afin de pouvoir se mettre au plaisir de ces clients.\n\nMoyen Atlas vous propose différent choix pour vos évènements : Pâtisserie, Boulangerie, Gâteaux artisanal, Gâteaux traditionnel, Macaron, Salé ...', 'VILL', NULL, '212522601077', 0, 0, 0, 0, '2020-06-30 15:28:37', 'INTE', 82, '2020-07-14 09:30:25', NULL, '', ' Casablanca Hay Al Mohammadi Patisserie Moyen Atlas Creer en 1982 a Casablanca, Moyen Atlas a pu realiser une eventuelle progression en savoir-faire et qualite de ces produits Boulangerie ou Patisserie. Depuis ce temps-la l\'innovation a pu se mettre en priorite afin de pouvoir se mettre au plaisir de ces clients.\n\nMoyen Atlas vous propose different choix pour vos evenements : Patisserie, Boulangerie, Gateaux artisanal, Gateaux traditionnel, Macaron, Sale ...    '),
(1471, '14718b0d268963dd0cfb808aac48a549829f', 'Casablanca', 'Maarif', '107 Boulevard Moulay Rachid,Quartier Racine Extension, ', 'LE MARLEY CASABLANCA', 'Le MARLY Casablanca est un Café-Restaurant raffiné installé dans un grand boulevard à Casablanca qui propose une carte créative à base de produits de saison dans un élégant cadre contemporain.', 'AUCU', NULL, '212522946676', 0, 0, 0, 0, '2020-06-30 15:30:58', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Maarif LE MARLEY CASABLANCA Le MARLY Casablanca est un Cafe-Restaurant raffine installe dans un grand boulevard a Casablanca qui propose une carte creative a base de produits de saison dans un elegant cadre contemporain.    '),
(1472, '1472daa96d9681a21445772454cbddf0cac1', 'Casablanca', 'Bourgogne', '140 Avenue Mohamed Sijilmassi, Casablanca 20250', 'Maison Caprices', 'Franchise spécialisée en traiteur salés, mignardises fines, Pâtisserie raffinée', 'VILL', 'Mme  TERKI ', '212522294414', 0, 0, 0, 0, '2020-06-30 15:42:49', 'INTE', 82, '2020-07-14 09:30:25', NULL, '', ' Casablanca Bourgogne Maison Caprices Franchise specialisee en traiteur sales, mignardises fines, Patisserie raffinee Mme  TERKI    '),
(1473, '1473ac796a52db3f16bbdb6557d3d89d1c5a', 'Casablanca', 'Gauthier', '31 Rue Sebou, Gauthier', 'Bondi Coffee Kitchen', 'Bondi Coffee Kitchen is an Australian style food and coffee concept in the heart of Casablanca bringing a modern eating experience to Morocco.\nOur mission is to offer you a clean, relaxed environment where you feel both at home or anywhere in the world.', 'VILL', NULL, '212651687707', 0, 0, 0, 0, '2020-06-30 15:49:32', 'INTE', 82, '2020-07-13 16:26:03', NULL, '', ' Casablanca Gauthier Bondi Coffee Kitchen Bondi Coffee Kitchen is an Australian style food and coffee concept in the heart of Casablanca bringing a modern eating experience to Morocco.\nOur mission is to offer you a clean, relaxed environment where you feel both at home or anywhere in the world.    '),
(1474, '14747d6044e95a16761171b130dcb476a43e', 'Casablanca', 'Mers Sultan', ' 84 Boulevard de Khouribga, Casablanca 20250', 'Petits Beurres Boulangerie Pâtisserie', 'Boulangerie avec spécialités françaises sucrées et salées, et gâteaux/pâtisseries marocains traditionnels.', 'VILL', NULL, '212522303837', 3, 0, 0, 0, '2020-07-01 08:16:47', 'INTE', 82, '2020-07-14 09:30:25', NULL, '', ' Casablanca Mers Sultan Petits Beurres Boulangerie Patisserie Boulangerie avec specialites francaises sucrees et salees, et gateaux/patisseries marocains traditionnels.    '),
(1475, '1475571d3a9420bfd9219f65b643d0003bf4', 'Casablanca', 'Bourgogne', '9 Rue d\'Ain Aouda\nCasablanca', 'ISHQ Kitchen', 'shq Kitchen porte bien son nom et met son amour de la nature à votre service en proposant une cuisine locale, saisonnière et aussi éthique que possible. C’est une adresse résolument verte que ce soit dans la décoration ou dans l’assiette qui prouve bien qu’on peut vivre sainement tout en se faisant plaisir. Les recettes de salades, de tartines et de sandwichs sont aussi audacieuses que gourmandes. On aime ses jus de fruits et légumes 100% crus et pressés à froid pour accompagner un bon plat.', 'VILL', NULL, '212522471763', 1, 0, 0, 0, '2020-07-01 08:25:11', 'INTE', 82, '2020-07-14 09:30:25', NULL, '', ' Casablanca Bourgogne ISHQ Kitchen shq Kitchen porte bien son nom et met son amour de la nature a votre service en proposant une cuisine locale, saisonniere et aussi ethique que possible. C’est une adresse resolument verte que ce soit dans la decoration ou dans l’assiette qui prouve bien qu’on peut vivre sainement tout en se faisant plaisir. Les recettes de salades, de tartines et de sandwichs sont aussi audacieuses que gourmandes. On aime ses jus de fruits et legumes 100% crus et presses a froid pour accompagner un bon plat.    '),
(1476, '147697275a23ca44226c9964043c8462be96', 'Casablanca', 'Maarif', 'Kenzi Tower Hôtel, Twin Center,\nBoulevard Zerktouni ', 'SKY 28', 'Au 28ème étage, le SKY 28 offre le plus beau point de vue qu’on puisse avoir sur la ville blanche.Tapas, cocktails d’exception,  musique live  du monde et DJ, attirent une clientèle hétéroclite à la recherche d’un moment privilégié aux rythmes de la musique live.\nPour vos évènements familiaux ou professionnels, privatisez le SKY 28, et épatez vos convives ! Animations, équipement, service personnalisé : le SKY 28 met à votre disposition tous les ingrédients d’une soirée privée réussie... en version VIP !', 'AUCU', 'TAZI', '212522978000', 0, 0, 0, 0, '2020-07-01 08:40:44', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Maarif SKY 28 Au 28eme etage, le SKY 28 offre le plus beau point de vue qu’on puisse avoir sur la ville blanche.Tapas, cocktails d’exception,  musique live  du monde et DJ, attirent une clientele heteroclite a la recherche d’un moment privilegie aux rythmes de la musique live.\nPour vos evenements familiaux ou professionnels, privatisez le SKY 28, et epatez vos convives ! Animations, equipement, service personnalise : le SKY 28 met a votre disposition tous les ingredients d’une soiree privee reussie... en version VIP ! TAZI   '),
(1477, '147778b9cab19959e4af8ff46156ee460c74', 'Casablanca', 'Maarif', '24 Bd Al Massira Al Khadra', 'Faces Beauty Maarif', 'Faces est un magasin beauté multimarques leader au Moyen-Orient, représentant une large sélection de parfums, make-up et soins de plusieurs marques de luxe telles que Dior, Chanel, YSL, Guerlain...En plus des marques exclusives comme L\'Occitane, etc.', 'NATI', 'Faces Beauty Maroc', '212522396674', 0, 0, 0, 0, '2020-07-01 08:46:16', 'INTE', 82, '2020-07-13 16:14:56', NULL, '', ' Casablanca Maarif Faces Beauty Maarif Faces est un magasin beaute multimarques leader au Moyen-Orient, representant une large selection de parfums, make-up et soins de plusieurs marques de luxe telles que Dior, Chanel, YSL, Guerlain...En plus des marques exclusives comme L\'Occitane, etc. Faces Beauty Maroc   '),
(1478, '147883cdcec08fbf90370fcf53bdd56604ff', 'Casablanca', 'Maarif', 'Angle Boulevard Zerktouni & Boulevard Anfa', 'BACK STAGE ', 'À la fois live club, restaurant et concept store, le BackStage, nouveau lieu de vie casablancais, aspire à mettre en lumière le talent marocain sous toutes ses formes, et invite à sa table un large public assoiffé de découvertes et de concerts de qualité, dans une ambiance d’échanges et de convivialité..', 'AUCU', NULL, '212660520528', 0, 0, 0, 0, '2020-07-01 08:48:07', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Maarif BACK STAGE  A la fois live club, restaurant et concept store, le BackStage, nouveau lieu de vie casablancais, aspire a mettre en lumiere le talent marocain sous toutes ses formes, et invite a sa table un large public assoiffe de decouvertes et de concerts de qualite, dans une ambiance d’echanges et de convivialite..    '),
(1479, '1479dc09c97fd73d7a324bdbfe7c79525f64', 'Casablanca', 'Maarif', '19 Boulevard Franklin Roosevelt, Casablanca', 'LA BRASSERIE DU BOULEVARD', 'La brasserie du boulevard une cuisine raffinée entre tradition et modernité dévoile ses secrets culinaires à travers une carte méditerranéenne variant au gré des saisons.  ', 'AUCU', NULL, '212669498519', 0, 0, 0, 0, '2020-07-01 08:53:25', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Maarif LA BRASSERIE DU BOULEVARD La brasserie du boulevard une cuisine raffinee entre tradition et modernite devoile ses secrets culinaires a travers une carte mediterraneenne variant au gre des saisons.      '),
