(1594, '15940ebcc77dc72360d0eb8e9504c78d38bd', 'Casablanca', 'Bourgogne', 'residence Sami Quartier, 108 Avenue Mohamed Sijilmassi ', 'K.BEAUTY', 'K.beauty vous appel prochainement à découvrir un univers dédié exclusivement à la femme, dans une ardeur placide très distinguée.\nEnvie de changer, besoin de relooking ou tout simplement en quête d\'excellence, l\'équipe de K.beauty vous accompagne pour une coupe ou coloration réussis, un bon coup de main pour un maquillage naturel sublimé, une alliance du bien être moderne avec le thermalisme traditionnel, des soins de corps et de visage spécifiques adaptés à vos besoins et enfin un talent esthétique qualifié.\n', 'AUCU', 'K.BEAUTY', '212522390929', 0, 0, 0, 0, '2020-07-02 10:24:20', 'INTE', 82, '2020-07-13 16:05:39', NULL, '', ' Mode & Beaute 2  Casablanca Bourgogne K.BEAUTY K.beauty vous appel prochainement a decouvrir un univers dedie exclusivement a la femme, dans une ardeur placide tres distinguee.\nEnvie de changer, besoin de relooking ou tout simplement en quete d\'excellence, l\'equipe de K.beauty vous accompagne pour une coupe ou coloration reussis, un bon coup de main pour un maquillage naturel sublime, une alliance du bien etre moderne avec le thermalisme traditionnel, des soins de corps et de visage specifiques adaptes a vos besoins et enfin un talent esthetique qualifie.\n K.BEAUTY   '),
(1595, '1595d88518acbcc3d08d1f18da62f9bb26ec', 'Casablanca', 'Ain Diab', 'Megarama Casablanca,\nBoulevard de la Corniche\n20000 CASABLANCA ', 'Cinéma Megarama', 'La franchise internationale Mégarama installée sur la corniche de Casablanca depuis plusieurs années est devenu une référence des salles de cinéma au Maroc. L\'entreprise propose en avant-première des films, nationaux et internationaux, pour petits et grands. Le cinéma est un lieu vaste disposant de plus d\'une dizaine de salles de projections afin de pourvoir diffuser plusieurs films simultanément. Les tarifs des séances sont compétitifs. Une buvette avec Popcorn et autres gourmandises est disponible à l\'entrée.', 'AUCU', NULL, '212522798888', 1, 0, 0, 0, '2020-07-02 10:25:27', 'INTE', 81, '2020-07-14 09:29:48', NULL, '', ' Casablanca Ain Diab Cinema Megarama La franchise internationale Megarama installee sur la corniche de Casablanca depuis plusieurs annees est devenu une reference des salles de cinema au Maroc. L\'entreprise propose en avant-premiere des films, nationaux et internationaux, pour petits et grands. Le cinema est un lieu vaste disposant de plus d\'une dizaine de salles de projections afin de pourvoir diffuser plusieurs films simultanement. Les tarifs des seances sont competitifs. Une buvette avec Popcorn et autres gourmandises est disponible a l\'entree.    '),
