(1601, '1601c559da2ba967eb820766939a658022c8', 'Casablanca', 'Racine', '26 rue Imam El Alloussi (en face de la clinique Badr)', 'Coco Beauty Bar Casablanca', 'L’institut de beauté Coco Beauty Bar, niché au cœur de Casablanca, vous accueille dans un espace ultra chic à la décoration moderne et design entièrement dédié aux soins esthétiques et au bien-être (onglerie- épilation, soins du visage, coiffure, massages). Au delà des nombreux services, l’institut Coco Beauty Bar se distingue par ses marques de soins Haut de gamme. Tous les produits utilisés sont élaborés pour garantir le plus grand respect de chaque type de peau et cheveux.', 'AUCU', 'Coco Beauty Bar', '212522208951', 0, 0, 0, 0, '2020-07-02 10:52:32', 'INTE', 82, '2020-07-13 16:05:39', NULL, '', ' Mode & Beaute 2  Casablanca Racine Coco Beauty Bar Casablanca L’institut de beaute Coco Beauty Bar, niche au cœur de Casablanca, vous accueille dans un espace ultra chic a la decoration moderne et design entierement dedie aux soins esthetiques et au bien-etre (onglerie- epilation, soins du visage, coiffure, massages). Au dela des nombreux services, l’institut Coco Beauty Bar se distingue par ses marques de soins Haut de gamme. Tous les produits utilises sont elabores pour garantir le plus grand respect de chaque type de peau et cheveux. Coco Beauty Bar   '),
