(1616, '1616962e56a8a0b0420d87272a682bfd1e53', 'Casablanca', 'Ain Diab', 'Bd De La Corniche, Tahiti Beach', 'LA TERRAZZA', ' Restaurant de la GENT FEMININE du tahiti beach club par excellence !!\nEn bord de mer, sur une vaste terrasse en teck ensoleillée, le restaurant LA TERRAZZA jouit d’un emplacement exceptionnel pour rendre hommage à une cuisine italienne authentique pour satisfaire une clientèle en quête de dépaysement.', 'AUCU', NULL, '212522797836', 0, 0, 0, 0, '2020-07-02 11:48:22', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Ain Diab LA TERRAZZA  Restaurant de la GENT FEMININE du tahiti beach club par excellence !!\nEn bord de mer, sur une vaste terrasse en teck ensoleillee, le restaurant LA TERRAZZA jouit d’un emplacement exceptionnel pour rendre hommage a une cuisine italienne authentique pour satisfaire une clientele en quete de depaysement.    '),
(1617, '1617297fa7777981f402dbba17e9f29e292d', 'Casablanca', 'Ain Diab', '92 Bd de la Corniche، Phare d\'El Hank،', 'LILY\'S', 'Mélange de spécialités thaï, coréennes, vietnamiennes, chinoises et japonaises, Lily’s est une invitation à découvrir le meilleur des mets de ces pays avec une vue spectaculaire sur l’océan. L’enseigne a fait appel à des chefs asiatiques et étoilés au Guide Michelin, notre consultant Ian Kittichai dont le restaurant de New York, Kittichai Restaurant, a été élu meilleur nouveau restaurant asiatique en 2005 par le magazine Food & Wine.', 'AUCU', NULL, '212522361271', 0, 0, 0, 0, '2020-07-02 13:29:58', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Ain Diab LILY\'S Melange de specialites thai, coreennes, vietnamiennes, chinoises et japonaises, Lily’s est une invitation a decouvrir le meilleur des mets de ces pays avec une vue spectaculaire sur l’ocean. L’enseigne a fait appel a des chefs asiatiques et etoiles au Guide Michelin, notre consultant Ian Kittichai dont le restaurant de New York, Kittichai Restaurant, a ete elu meilleur nouveau restaurant asiatique en 2005 par le magazine Food & Wine.    '),
