(1631, '16316ba3af5d7b2790e73f0de32e5c8c1798', 'Casablanca', 'Ain Diab', 'Complexe au Petit Rocher La Corniche, Casablanca ', 'Restaurant El Cenador', '  El Cenador est le restaurant ibérique chic de Casablanca. Très prisé pour les repas d\'affaires, le lieu est situé au pied du phare, sur la corniche avec une vue imprenable sur la mosquée Hassan II de Casablanca. On y déguste une cuisine gastronomique méditerranéenne un grand choix de poissons et de fruits de mer cuisinés à la mode andalouse et une paëlla devenue une référence. Une adresse gastronomique indémodable récompensée par trois fourchettes d\'or depuis plusieurs années.\n', 'AUCU', NULL, '212522363603', 0, 0, 0, 0, '2020-07-02 14:12:47', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Ain Diab Restaurant El Cenador   El Cenador est le restaurant iberique chic de Casablanca. Tres prise pour les repas d\'affaires, le lieu est situe au pied du phare, sur la corniche avec une vue imprenable sur la mosquee Hassan II de Casablanca. On y deguste une cuisine gastronomique mediterraneenne un grand choix de poissons et de fruits de mer cuisines a la mode andalouse et une paella devenue une reference. Une adresse gastronomique indemodable recompensee par trois fourchettes d\'or depuis plusieurs annees.\n    '),
