(1757, '1757d2cdf047a6674cef251d56544a3cf029', 'Casablanca', 'Maarif', 'Angle rue Acharif Al Idrissi et rue Kadi Lass - Maarif', 'Wang Thai Spa & Massage', 'Pénétrez dans un lieu de quiétude et de détente par excellence.\nDans un cadre agréable et discret, les miracles de la relaxation s\'opère ...\nNos thérapeutes thaïlandaises, diplômées de la « WAT PO High SCHOOL » de BANGKOK, ont le plaisir de vous accueillir et vous proposent différents massages selon les techniques ancestrales du traditionnel thaï massage.\nUn lieu magique, une évasion dans le temps, plongé dans l’ambiance de la Thaïlande avec ces essences florale et musique douce, un voyage dans la détente et le bien être.', 'AUCU', 'Wang Thai Spa & Massage', '212522257541', 2, 0, 0, 0, '2020-07-03 14:42:33', 'INTE', 82, '2020-07-13 16:05:39', NULL, '', ' Mode & Beaute 2  Casablanca Maarif Wang Thai Spa & Massage Penetrez dans un lieu de quietude et de detente par excellence.\nDans un cadre agreable et discret, les miracles de la relaxation s\'opere ...\nNos therapeutes thailandaises, diplomees de la « WAT PO High SCHOOL » de BANGKOK, ont le plaisir de vous accueillir et vous proposent differents massages selon les techniques ancestrales du traditionnel thai massage.\nUn lieu magique, une evasion dans le temps, plonge dans l’ambiance de la Thailande avec ces essences florale et musique douce, un voyage dans la detente et le bien etre. Wang Thai Spa & Massage   '),
