(1760, '1760e22dd5dabde45eda5a1a67772c8e25dd', 'Casablanca', 'Racine', 'Bd Massira El Khadra, Rue Ibnou Yakdan, N° 2. Résidence Rawafid, Quartier Racine', 'Angel Institut', 'Angel Institut Casablanca est à la fois un salon de coiffure, un centre d\'esthétique et un Hammam & Spa, idéal pour se relooker de la tête aux pieds.', 'AUCU', 'Angel Institut', '212522395777', 11, 0, 0, 0, '2020-07-03 15:04:17', 'INTE', 82, '2020-07-13 16:05:39', NULL, '', ' Mode & Beaute 2  Casablanca Racine Angel Institut Angel Institut Casablanca est a la fois un salon de coiffure, un centre d\'esthetique et un Hammam & Spa, ideal pour se relooker de la tete aux pieds. Angel Institut   '),
(1761, '17617283518d47a05a09d33779a17adf1707', 'Casablanca', 'Maarif', '35 rue cadi lass maarif', 'POP CHOU MAARIF', 'Pâtisserie et salon de thé C\'est dans un cadre luxueux bercé dans une ambiance musicale Chillout et Lounge que Popchou vous accueille.\nPopchou c’est l’endroit idéal pour prendre le petit-déjeuner ou une simple tasse de thé et découvrir une large sélection de pâtisseries composée d’éclairs de choux et religieuses.', 'AUCU', NULL, '212522473673', 0, 0, 0, 0, '2020-07-06 08:36:44', 'INTE', 81, '2020-07-14 09:30:25', NULL, '', ' Casablanca Maarif POP CHOU MAARIF Patisserie et salon de the C\'est dans un cadre luxueux berce dans une ambiance musicale Chillout et Lounge que Popchou vous accueille.\nPopchou c’est l’endroit ideal pour prendre le petit-dejeuner ou une simple tasse de the et decouvrir une large selection de patisseries composee d’eclairs de choux et religieuses.    '),
