(1765, '17658698ff92115213ab187d31d4ee5da8ea', 'Casablanca', 'Centre Ville', 'Avenue des Nations Unies Hyatt Regency Casablanca', 'DAR BEIDA', 'Le restaurant marocain Dar Beida situé au Hyatt Regency Casablanca propose à votre palais un large éventail de saveurs régionales. Le menu propose une cuisine marocaine authentique préparée avec des ingrédients frais, tel la soupe de harira, la fameuse pastille aux fruits de mer, l\'excellent tajine au talouine au safran ou encore les délicieuses pâtisseries marocaines. Dînez sous une tente arabe mythique rappelant la vie nomade du désert tout en savourant vos mets sous les chants de l\'orchestre et le spectacle de danseuses du ventre.', 'AUCU', NULL, '212632333375', 0, 0, 0, 0, '2020-07-06 08:51:07', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Centre Ville DAR BEIDA Le restaurant marocain Dar Beida situe au Hyatt Regency Casablanca propose a votre palais un large eventail de saveurs regionales. Le menu propose une cuisine marocaine authentique preparee avec des ingredients frais, tel la soupe de harira, la fameuse pastille aux fruits de mer, l\'excellent tajine au talouine au safran ou encore les delicieuses patisseries marocaines. Dinez sous une tente arabe mythique rappelant la vie nomade du desert tout en savourant vos mets sous les chants de l\'orchestre et le spectacle de danseuses du ventre.    '),
(1766, '176696a93ba89a5b5c6c226e49b88973f46e', 'Casablanca', 'Sidi Moumen', 'n 32, sidi moumen jdid Group, 9 Rue 6, Casablanca 20250', 'vetement turk hanan ', 'Découvrez des Vêtements Turk chic et moderne ,venus tout droit du prêt-à-porter d’Istanbul. Nous offrons des produits à tous les budgets alliant bonne qualité et prix compétitif pour satisfaire au mieux notre aimable clientèle.\n', 'NATI', NULL, '212671072777', 0, 0, 0, 0, '2020-07-06 08:54:29', 'INTE', 82, '2020-07-13 16:05:39', NULL, '', ' Mode & Beaute 2  Mode & Beaute 2  Casablanca Sidi Moumen vetement turk hanan  Decouvrez des Vetements Turk chic et moderne ,venus tout droit du pret-a-porter d’Istanbul. Nous offrons des produits a tous les budgets alliant bonne qualite et prix competitif pour satisfaire au mieux notre aimable clientele.\n    '),
(1767, '1767e8fd4a8a5bab2b3785d794ab51fef55c', 'Casablanca', 'Maarif', '33 Angle rues Najib Mahfoud et Tawfik El Hakim, Quartier Gauthier (1,46 km)\nCasablanca', 'ILOLI', 'Notre ambition à ILOLI est de « transporter » nos clients à Tokyo, le temps d’un repas convivial, exotique et savoureux . Associer le meilleur du Maroc et du Japon à travers la gastronomie, faire collaborer les hommes, les techniques, les ustensiles, les condiments, les traditions des deux pays pour créer une cuisine à la fois inventive et authentique, tel est notre concept.', 'AUCU', NULL, '212608866633', 0, 0, 0, 0, '2020-07-06 08:56:17', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Maarif ILOLI Notre ambition a ILOLI est de « transporter » nos clients a Tokyo, le temps d’un repas convivial, exotique et savoureux . Associer le meilleur du Maroc et du Japon a travers la gastronomie, faire collaborer les hommes, les techniques, les ustensiles, les condiments, les traditions des deux pays pour creer une cuisine a la fois inventive et authentique, tel est notre concept.    '),
(1768, '1768db29450c3f5e97f97846693611f98c15', 'Casablanca', 'Maarif', 'Rue Ibn Mohamed Meskaoui, Maarif ( En face de Jeff de bruges) Casablanca', 'Kaftanki by Mautassin', 'Découvrez des pièces uniques de caftans issu de la collection Kaftanki by Mautassin.\nD’autres modèles vous attendent dans notre boutique à Casablanca.', 'AUCU', NULL, '212666749891', 0, 0, 0, 0, '2020-07-06 08:58:54', 'INTE', 82, '2020-07-13 16:05:39', NULL, '', ' Mode & Beaute 2  Casablanca Maarif Kaftanki by Mautassin Decouvrez des pieces uniques de caftans issu de la collection Kaftanki by Mautassin.\nD’autres modeles vous attendent dans notre boutique a Casablanca.    '),
