(1772, '1772299570476c6f0309545110c592b6a63b', 'Casablanca', 'Gauthier', 'Angle Rue Taha Hussein et rue Abou chouaib addoukkali , Résidence Galerie , Quartier Gauthier .', 'LE YEEL\'S', 'Restaurant et Salon de thé, Le Yeels offre une cuisine méditerranéenne aux saveurs gourmandes et légères. Au Menu, Salades composées, quiches, Sandwiches variés et Burgers, ainsi que des plats Bistrots tels que le Filet de bœuf, l\'Entrecôte ou encore le Filet de St Pierre. On y trouve aussi une large variétés de desserts tels que Cheesecake, Tarte au citron ou tarte aux pommes. Des glaces artisanales et des crêpes sucrées ou salées sont aussi proposées.', 'AUCU', NULL, '212522275845', 0, 0, 0, 0, '2020-07-06 09:12:04', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Gauthier LE YEEL\'S Restaurant et Salon de the, Le Yeels offre une cuisine mediterraneenne aux saveurs gourmandes et legeres. Au Menu, Salades composees, quiches, Sandwiches varies et Burgers, ainsi que des plats Bistrots tels que le Filet de bœuf, l\'Entrecote ou encore le Filet de St Pierre. On y trouve aussi une large varietes de desserts tels que Cheesecake, Tarte au citron ou tarte aux pommes. Des glaces artisanales et des crepes sucrees ou salees sont aussi proposees.    '),
(1773, '17734abe17a1c80cbdd2aa241b70840879de', 'Casablanca', NULL, NULL, 'Maman Avenue', 'Maman Avenue est la première boutique en ligne dédiée exclusivement à la mode pour femmes enceintes au Maroc.\nVêtements de grossesse ( hauts, robes, pantalons, jupes, jeans, leggings ) et aussi des Vêtements spécialement conçus pour les mamans qui allaitent.\nLingerie de grossesse et d\'allaitement.\nles pyjamas et nuisettes.\nLes Bolas de grossesse notre coup de coeur de l\'année.\n', 'AUCU', 'Maman Avenue', '212663016902', 0, 0, 0, 0, '2020-07-06 09:16:10', 'INTE', 82, '2020-07-13 16:05:39', NULL, NULL, ' Mode & Beaute 2  Casablanca  Maman Avenue Maman Avenue est la premiere boutique en ligne dediee exclusivement a la mode pour femmes enceintes au Maroc.\nVetements de grossesse ( hauts, robes, pantalons, jupes, jeans, leggings ) et aussi des Vetements specialement concus pour les mamans qui allaitent.\nLingerie de grossesse et d\'allaitement.\nles pyjamas et nuisettes.\nLes Bolas de grossesse notre coup de coeur de l\'annee.\n Maman Avenue   '),
(1774, '1774f0bda020d2470f2e74990a07a607ebd9', 'Casablanca', 'Ain Diab', '\nAnfaplace Shopping Center - Boulevard de la Corniche, Ain Diab (4,32 km)', 'LE PARADIS DU FRUIT', 'Le Paradis du Fruit sur la promenade d’Anfa Place, conçu par le grand designer Philippe Starck, propose une gamme saine et naturelle centrée autour d\'une spécialité : LE FRUIT. Ce lieu est la conjugaison unique d’un restaurant, d’un bar à fruits et d’un glacier où l’on retrouve toute la fraîcheur et le naturel d’une carte savoureuse.', 'AUCU', NULL, '212522796909', 0, 0, 0, 0, '2020-07-06 09:21:27', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Ain Diab LE PARADIS DU FRUIT Le Paradis du Fruit sur la promenade d’Anfa Place, concu par le grand designer Philippe Starck, propose une gamme saine et naturelle centree autour d\'une specialite : LE FRUIT. Ce lieu est la conjugaison unique d’un restaurant, d’un bar a fruits et d’un glacier ou l’on retrouve toute la fraicheur et le naturel d’une carte savoureuse.    '),
