(1778, '17786709e8d64a5f47269ed5cea9f625f7ab', 'Casablanca', 'Oasis', 'Route de l\'Oasis, Casablanca 20000', 'La Carré d\'Or', 'Site idéal pour l’organisation de vos congrès, salons internationaux, séminaires… LE CARRÉ D’OR accueille vos événements à proximité du quartier d’affaires de Casablanca.\nBénéficiant d’un emplacement central et privilégié, d’une proximité avec les principaux axes routiers, LE CARRÉ D’OR est conçu comme un carrefour de rencontres qui permet à chacun de se sentir immédiatement à l’aise.', 'AUCU', NULL, '212522995210', 0, 0, 0, 0, '2020-07-06 09:34:41', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Oasis La Carre d\'Or Site ideal pour l’organisation de vos congres, salons internationaux, seminaires… LE CARRE D’OR accueille vos evenements a proximite du quartier d’affaires de Casablanca.\nBeneficiant d’un emplacement central et privilegie, d’une proximite avec les principaux axes routiers, LE CARRE D’OR est concu comme un carrefour de rencontres qui permet a chacun de se sentir immediatement a l’aise.    '),
