(1782, '17824a2ddf148c5a9c42151a529e8cbdcc06', 'Casablanca', 'Maarif', '25 Rue Mustapha El Manfalouti, Casablanca 20060', 'TIKITAPAS', 'Les origines de la paella remonte à l’époque de Valencia musulmane du XIV siècle, quand les paysans  cuisinés le riz de la lagune avec des morceaux de viandes, poissons et légumes restants Al Bakia .Chez Tiki Tapas on poursuit la tradition de Castellon (Valencia) ou sont toujours utilisés des produits frais et de saison ou ce n’ai jamais assai pour réunir nos clients en famille et entre amis autour d’une paella originale.\n', 'AUCU', NULL, '212522451313', 0, 0, 0, 0, '2020-07-06 09:47:55', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Maarif TIKITAPAS Les origines de la paella remonte a l’epoque de Valencia musulmane du XIV siecle, quand les paysans  cuisines le riz de la lagune avec des morceaux de viandes, poissons et legumes restants Al Bakia .Chez Tiki Tapas on poursuit la tradition de Castellon (Valencia) ou sont toujours utilises des produits frais et de saison ou ce n’ai jamais assai pour reunir nos clients en famille et entre amis autour d’une paella originale.\n    '),
