(1787, '1787d860bd12ce9c026814bbdfc1c573f0f5', 'Casablanca', 'Maarif', '17 Rue Kadi Iass Maarif', 'Etam maarif', 'En 1916, Etam voit le jour avec cette femme \"moderne\" qui évoluera au fil des décennies. Provocatrices dans les années 20, naturelle dans les années 70, conquérante dans les années 80, elle prendra mille et un visages. Des petites conquêtes aux grandes victoires, les vêtements et les dessous de la vie des femmes ont fait l\'histoire d\'Etam.\n\nLes collections Lingerie sont synonyme de plaisir, séduction et authenticité.', 'NATI', 'Etam', '212522222222', 0, 0, 0, 0, '2020-07-06 10:05:03', 'INTE', 82, '2020-07-13 16:05:39', NULL, '', ' Mode & Beaute 2  Mode & Beaute 2  Casablanca Maarif Etam maarif En 1916, Etam voit le jour avec cette femme \"moderne\" qui evoluera au fil des decennies. Provocatrices dans les annees 20, naturelle dans les annees 70, conquerante dans les annees 80, elle prendra mille et un visages. Des petites conquetes aux grandes victoires, les vetements et les dessous de la vie des femmes ont fait l\'histoire d\'Etam.\n\nLes collections Lingerie sont synonyme de plaisir, seduction et authenticite. Etam   '),
