(1819, '181917c3433fecc21b57000debdf7ad5c930', 'Casablanca', 'Ain Diab', 'Boulevard de la Corniche, Casablanca', 'FOUR SEASON ', 'Baigné par la lumière du soleil, entouré de paysages et le glamour du lifestyle en bord de mer. Une bouffée d’air frais dans la capitale économique du Royaume. À seulement 10 minutes du centre ville et des quartiers des affaires. Profiter de la douce brise marine sur votre terrasse ou dans le confort de votre chambre et laisser-vous bercer par le déferlement paisible des vagues. Alliant élégance contemporaine et traditions marocaines, découvrez l\'architecture exceptionnelle de la Ville Blanche. Admirez l\'évoluante scène artistique et gastronomi', 'AUCU', 'FOUR SEASON ', '212529073700', 0, 0, 0, 0, '2020-07-06 12:04:14', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Ain Diab FOUR SEASON  Baigne par la lumiere du soleil, entoure de paysages et le glamour du lifestyle en bord de mer. Une bouffee d’air frais dans la capitale economique du Royaume. A seulement 10 minutes du centre ville et des quartiers des affaires. Profiter de la douce brise marine sur votre terrasse ou dans le confort de votre chambre et laisser-vous bercer par le deferlement paisible des vagues. Alliant elegance contemporaine et traditions marocaines, decouvrez l\'architecture exceptionnelle de la Ville Blanche. Admirez l\'evoluante scene artistique et gastronomi FOUR SEASON    '),
(1820, '1820f2d887e01a80e813d9080038decbbabb', 'Casablanca', 'Maarif', '86 boulevard Franklin Roosevelt (2,65 km)\n20000 Casablanca', 'GAPI VILLA', 'GAPI est une société de restauration et traiteur de luxe basée à Casablanca depuis 1997. Elle a su innover en permanence dans le monde de la restauration et de la gastronomie en ayant débuté comme une pâtisserie offrant des services traiteur.', 'AUCU', 'GAPI VILLA', '212522941096', 0, 0, 0, 0, '2020-07-06 13:27:19', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Maarif GAPI VILLA GAPI est une societe de restauration et traiteur de luxe basee a Casablanca depuis 1997. Elle a su innover en permanence dans le monde de la restauration et de la gastronomie en ayant debute comme une patisserie offrant des services traiteur. GAPI VILLA   '),
(1821, '1821596dedf4498e258e4bdc9fd70df9a859', 'Casablanca', 'Bourgogne', '5 Rue ibn Bakia , Casablanca 20250', 'CAKE UP STORE ', '« Cake UP » est devenu l\'adresse incontournable pour marquer chaque événement avec des gâteaux personnalisés réussis tant visuellement que gustativement. Naturellement « Simple » est né. Les fondateurs ont voulu se relancer dans l\'aventure en créant un nouveau concept de « bakery coffee » sur l’une des artères Casablancaises les plus prisées du moment. L’idée et de proposer aux clients un voyage en Amérique, avec de la pâtisserie au goût authentique et onctueux, le tout dans un cadre chaleureux et convivial.', 'AUCU', 'CAKE UP STORE ', '212678228947', 0, 0, 0, 0, '2020-07-06 13:35:13', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Bourgogne CAKE UP STORE  « Cake UP » est devenu l\'adresse incontournable pour marquer chaque evenement avec des gateaux personnalises reussis tant visuellement que gustativement. Naturellement « Simple » est ne. Les fondateurs ont voulu se relancer dans l\'aventure en creant un nouveau concept de « bakery coffee » sur l’une des arteres Casablancaises les plus prisees du moment. L’idee et de proposer aux clients un voyage en Amerique, avec de la patisserie au gout authentique et onctueux, le tout dans un cadre chaleureux et convivial. CAKE UP STORE    '),
