(1833, '18339a1de01f893e0d2551ecbb7ce4dc963e', 'Casablanca', 'Ain Diab', 'Bd De La Corniche, C/O Villa Blanca, Casablanca 20100', 'LE RELAIS DU PARIS', 'Un joli petit bout de Paris gastronomique en plein cœur de la Corniche casablancaise, avec une cuisine de haute qualité, raffinée, délicate, sans faux-semblants et une terrasse à la vue imprenable. Ainsi pourrait-on définir le Relais de Paris, la brasserie casablancaise de luxe, où plaisirs gustatifs riment avec authenticité et convivialité.', 'AUCU', 'le relais du paris', '212522392510', 0, 0, 0, 0, '2020-07-06 14:16:53', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Ain Diab LE RELAIS DU PARIS Un joli petit bout de Paris gastronomique en plein cœur de la Corniche casablancaise, avec une cuisine de haute qualite, raffinee, delicate, sans faux-semblants et une terrasse a la vue imprenable. Ainsi pourrait-on definir le Relais de Paris, la brasserie casablancaise de luxe, ou plaisirs gustatifs riment avec authenticite et convivialite. le relais du paris   '),
