(1842, '184257c0531e13f40b91b3b0f1a30b529a1d', 'Casablanca', 'Centre Ville', '95 rue du Prince Moulay-Abdallah, Casablanca Maroc', 'AL MOUNIA', 'Dans un décor traditionnel magnifique, on sert une cuisine marocaine très classique comme des tajines, du couscous et de la pastilla, fort bien exécutée. Le tout accompagné d\'un bon vin marocain. Planté d\'un arbre centenaire, le jardin est plus qu\'agréable pour un déjeuner paisible et ensoleillé. Le salon tout en zelliges offre, lui, un cadre idéal pour un tête-à-tête. Seul bémol : les portions sont parfois insuffisantes, notamment pour le prix déboursé. Toutefois, l’accueil professionnel et l’ambiance raffinée vous feront passer un très bon.', 'AUCU', NULL, '212522222669', 0, 0, 0, 0, '2020-07-06 14:43:02', 'INTE', 81, '2020-07-13 16:26:03', NULL, '', ' Casablanca Centre Ville AL MOUNIA Dans un decor traditionnel magnifique, on sert une cuisine marocaine tres classique comme des tajines, du couscous et de la pastilla, fort bien executee. Le tout accompagne d\'un bon vin marocain. Plante d\'un arbre centenaire, le jardin est plus qu\'agreable pour un dejeuner paisible et ensoleille. Le salon tout en zelliges offre, lui, un cadre ideal pour un tete-a-tete. Seul bemol : les portions sont parfois insuffisantes, notamment pour le prix debourse. Toutefois, l’accueil professionnel et l’ambiance raffinee vous feront passer un tres bon.    '),
